import "./header.css";

export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitlesLarge">Green Kitchen Stories</span>
        <span className="headerTitlesSmall">
          We help you cook healthy and affordable meals
        </span>
      </div>
      <img
        className="headerImage"
        src="https://i.ibb.co/Z1xpKQv/shutterstock-1650211621.jpg"
        alt="cooking"
      />
    </div>
  );
}
